import { getTypes } from "../actions";


export default function PokemonCreated(){
    const dispatch=useDispatch()
    const type=useSelector((state)=>state.types)

    const [input,setInput]=useState({
        name:"",
        vida:"",
        ataque:"",
        defensa:"",
        velocidad:"",
        altura:"",
        peso:"",
        type:[]
    })
    useEffect(()=>{
        dispatch(getTypes())
    },[])

    return (
        <div>
            <Link to='/home'><button>Volver</button></Link>
            
        </div>
    )
}
